INSERT INTO [CMS_WebTemplate] ([WebTemplateID], [WebTemplateDisplayName], [WebTemplateFileName], [WebTemplateDescription], [WebTemplateGUID], [WebTemplateLastModified], [WebTemplateName], [WebTemplateOrder], [WebTemplateLicenses], [WebTemplatePackages]) VALUES (75, N'Corporate Site', N'~\App_Data\Templates\CorporateSite', N'This is a web template for a general corporate site. It''s used as a showcase of Kentico CMS capabilities and it can be used as a starting site that you modify as needed. It uses the portal engine and it''s the recommended choice for developers who are new to Kentico CMS.', '48f74a3f-3447-409e-aeec-9aa402a764bc', '20110714 18:19:16', N'CorporateSite', 1, N'F;S;B;N;C;P;R;E;U;X;', NULL)
INSERT INTO [CMS_WebTemplate] ([WebTemplateID], [WebTemplateDisplayName], [WebTemplateFileName], [WebTemplateDescription], [WebTemplateGUID], [WebTemplateLastModified], [WebTemplateName], [WebTemplateOrder], [WebTemplateLicenses], [WebTemplatePackages]) VALUES (79, N'E-commerce Site', N'~\App_Data\Templates\EcommerceSite', N'This is a web template for a simple E-commerce site. It''s used as a showcase of Kentico CMS E-commerce module capabilities and it can be used as a starting site that you modify as needed. It uses the portal engine and it''s the recommended choice for developers who are new to Kentico CMS.', '23cdbe82-802b-4c38-82cd-95f510e2876d', '20110714 18:19:09', N'ECommerceSite', 2, N'C;E;U;X;', N'ECM;')
INSERT INTO [CMS_WebTemplate] ([WebTemplateID], [WebTemplateDisplayName], [WebTemplateFileName], [WebTemplateDescription], [WebTemplateGUID], [WebTemplateLastModified], [WebTemplateName], [WebTemplateOrder], [WebTemplateLicenses], [WebTemplatePackages]) VALUES (80, N'Personal Site', N'~\App_Data\Templates\PersonalSite', N'This is a web template for a sample Personal site. Several Kentico CMS features, such as blogs, forums and photo galleries, are included. It can be used as a cornerstone for the custom personal site development. The template uses the portal engine and it is the recommended choice for developers who are new to Kentico CMS.', 'f2022396-1508-42c3-8d0f-9a41d7c7be57', '20110714 18:19:04', N'PersonalSite', 3, N'F;S;B;N;C;P;R;E;U;X;', NULL)
INSERT INTO [CMS_WebTemplate] ([WebTemplateID], [WebTemplateDisplayName], [WebTemplateFileName], [WebTemplateDescription], [WebTemplateGUID], [WebTemplateLastModified], [WebTemplateName], [WebTemplateOrder], [WebTemplateLicenses], [WebTemplatePackages]) VALUES (81, N'Community Site', N'~\App_Data\Templates\CommunitySite', N'This is a web site template for a sample community site. Social networking features of Kentico CMS are used on the site to give you an idea of how they can be used on your web site. You can also modify this web site and use it as a base for the development of your own site. It uses the portal engine and is recommended for developers who are new to Kentico CMS.', '872ccfbc-3b4a-4c91-b99d-a5b15bcea3c3', '20110714 18:18:54', N'CommunitySite', 4, N'U;X;', N'SCN;')
INSERT INTO [CMS_WebTemplate] ([WebTemplateID], [WebTemplateDisplayName], [WebTemplateFileName], [WebTemplateDescription], [WebTemplateGUID], [WebTemplateLastModified], [WebTemplateName], [WebTemplateOrder], [WebTemplateLicenses], [WebTemplatePackages]) VALUES (86, N'Intranet Portal', N'~\App_Data\Templates\IntranetPortal', N'This is a ready-to-use website template for a sample intranet portal site. The site showcases many features useful for a company intranet, such as sub-sections dedicated to departments or workgroups and document or project management. You may use it as a base for your own company intranet by replacing the sample data with your own. It uses the portal engine and may be used by developers who are new to Kentico CMS.', '7cab38db-8c2d-4bd6-95b9-d451ac08fbab', '20110714 18:18:47', N'IntranetPortal', 5, N'B;U;X;', N'SCN;DOC;')
INSERT INTO [CMS_WebTemplate] ([WebTemplateID], [WebTemplateDisplayName], [WebTemplateFileName], [WebTemplateDescription], [WebTemplateGUID], [WebTemplateLastModified], [WebTemplateName], [WebTemplateOrder], [WebTemplateLicenses], [WebTemplatePackages]) VALUES (21, N'Blank Site', N'~\App_Data\Templates\BlankSite', N'This template is intended for developers who want to create a new web site from scratch. It uses the portal engine.', '1925540f-4765-4159-8f1a-cd8c28f35ad9', '20110714 18:18:41', N'BlankSite', 6, N'F;S;B;N;C;P;R;E;U;X;', NULL)
INSERT INTO [CMS_WebTemplate] ([WebTemplateID], [WebTemplateDisplayName], [WebTemplateFileName], [WebTemplateDescription], [WebTemplateGUID], [WebTemplateLastModified], [WebTemplateName], [WebTemplateOrder], [WebTemplateLicenses], [WebTemplatePackages]) VALUES (77, N'Blank Site ASPX', N'~\App_Data\Templates\BlankSiteASPX', N'This template is intended for developers who want to create a new web site from scratch. It uses the ASPX page templates that require a higher level of .NET knowledge than the portal engine.', '762b1a36-8d31-4df4-beb8-cfe242703620', '20110714 18:18:36', N'BlankSiteASPX', 7, N'F;S;B;N;C;P;R;E;U;X;', NULL)
